import React from "react";

const Counter = () => {
	const count = 0;
	const formatCount = () => {
		count === 0 ? 'empty' : count
	};
	return (
		<>
		<h1>{formatCount}</h1>
		<button>Прибавить</button>
		<button>Убавить</button>
		</>
	);
}

export default Counter;
